const GET_TODO = 'GET_TODO'
const BASE_URL = 'http://localhost:3000'
const TODOS_URL = `${BASE_URL}/todos`

export const getTodo = (todo) => dispatch =>  {
            dispatch({
            type: GET_TODO,
            todo
        })
}
